__d((function(g,r,i,a,m,e,d){Object.defineProperty(e,"__esModule",{value:!0}),e.mq001s01=void 0;var t=r(d[0]);e.mq001s01={id:"mq-001-s01",title:"Planetfall",description:"Your arrival at Gamma-9 reveals the realities of your new assignment as Colony Governor.",sections:[{id:"intro",text:"The 'Stellar Cartographer' shudders through re-entry. Below, Gamma-9 resolves: ochre dust, rock formations, and the glint of prefab structures under a harsh sun. Your new assignment as Governor awaits.",isNarration:!0,next:"landing-zone"},{id:"landing-zone",text:"You disembark into the harsh climate. The air tastes metallic and thin. The admin center operates on emergency lighting, power conduits whining behind panels.",isNarration:!0,next:"datapad-review"},{id:"datapad-review",text:"As the dust settles, you review your assignment: 'SECTOR GOVERNOR. ASSIGNMENT: GAMMA-9. Classification: Developing Resource Zone, Outer Reach. Priority: Accelerated resource development.'",isNarration:!0,next:"appointment-message-intro"},{id:"appointment-message-intro",text:"You replay the recorded message for the nineteenth time.",isNarration:!0,next:"appointment-message"},{id:"appointment-message",text:"Your candidacy has been evaluated against strategic resource development needs. Gamma-9 is designated for accelerated resource development with promising mineral and energy potential. Meet output targets. Progress through Sacrifice.",character:"Council Message",next:"message-reflection"},{id:"message-reflection",text:"The Countil's expectations weigh heavily. The ancient creed 'Progress through Sacrifice' means something just that bit different now.",isNarration:!0,next:"tavi-appears"},{id:"tavi-appears",text:"A woman emerges from an office. Administrator's uniform. Worn, but clean.",isNarration:!0,next:"tavi-greeting"},{id:"tavi-greeting",text:"Governor. You made it. Tavi Morrigan, Station Administrator.",character:"Tavi",next:"tavi-state-intro"},{id:"tavi-state-intro",text:"She gestures around at the spartan administrative center.",isNarration:!0,next:"tavi-state"},{id:"tavi-state",text:"Welcome to Gamma-9. Don't believe everything the briefing told you. Supplies have a habit of getting 're-prioritized' en route to the Outer Reach.",character:"Tavi",next:"tavi-shows-display-intro"},{id:"tavi-shows-display-intro",text:"She brings up a wall console. Resource levels flash warning amber: Energy, Foodstuffs, Minerals, all below optimal levels.",isNarration:!0,next:"tavi-shows-display"},{id:"tavi-shows-display",text:"This is where we stand. Not ideal. And the Hegemony has assigned your first resource quota already. We need to get moving.",character:"Tavi",next:"tavi-waits"},{id:"tavi-waits",text:"Tavi waits, watching your reaction to the display with impatience.",isNarration:!0,choices:[{id:"choice-assess",text:"What are our immediate priorities?",nextSectionId:"response-assess",branchKey:"focus-priorities"},{id:"choice-quota",text:"What exactly are we expected to produce?",nextSectionId:"response-quota",branchKey:"focus-quota"},{id:"choice-resources",text:"What resources and facilities do we currently have?",nextSectionId:"response-resources",branchKey:"focus-assets"}]},{id:"response-assess",text:"Energy production. Then we'll need food production and mineral extraction to meet the initial quota.",character:"Tavi",next:"quota-details-intro"},{id:"response-quota",text:"Your initial quota is relatively modest - some minerals and food.",character:"Tavi",next:"quota-details-intro"},{id:"response-resources",text:"We have basic infrastructure - minimal power generation, rudimentary housing, and essential life support.",character:"Tavi",next:"quota-details-intro"},{id:"quota-details-intro",text:"The console displays your first quota requirements: 100 units of minerals and 25 units of food.",isNarration:!0,next:"final-situation"},{id:"final-situation",text:"You consider the colony's needs and the Hegemony's expectations.",isNarration:!0,choices:[{id:"choice-power-focus",text:"Okay. Let's start with the Energy Plant.",nextSectionId:"response-power-focus",branchKey:"focus-energy"},{id:"choice-balanced",text:"We need to develop all resources simultaneously.",nextSectionId:"response-balanced",branchKey:"focus-balanced"},{id:"choice-quota-focus",text:"Let's prioritize the exact resources we need to deliver.",nextSectionId:"response-quota-focus",branchKey:"focus-quota-direct"}]},{id:"response-power-focus",text:"Sensible choice. Without sufficient energy, nothing else functions efficiently. I'll help you get the construction plans ready.",character:"Tavi",next:"scene-end-narration"},{id:"response-balanced",text:"A well-rounded approach should work. We'll need to be careful with resource allocation, but it could pay off if we execute well.",character:"Tavi",next:"scene-end-narration"},{id:"response-quota-focus",text:"Direct and pragmatic. Meeting the quota is certainly our first priority. Let's get those resource extractors operational.",character:"Tavi",next:"scene-end-narration"},{id:"scene-end-narration",text:"With plans taking shape, you step into your role as Governor of Gamma-9.",isNarration:!0}],rewards:{resources:{[t.ResourceType.SOLARS]:500},questUnlocks:["qq-001"]},nextScenes:{"focus-priorities":"mq-001-s02","focus-quota":"mq-001-s02","focus-assets":"mq-001-s02","focus-energy":"mq-001-s02","focus-balanced":"mq-001-s02","focus-quota-direct":"mq-001-s02"}}}),1729,[708]);
__d((function(g,r,i,a,m,e,d){Object.defineProperty(e,"__esModule",{value:!0}),e.mq001s02=void 0;e.mq001s02={id:"mq-001-s02",title:"Rising Expectations",description:"Having met your initial quota, Hegemony Oversight takes notice and increases demands on your colony.",requirements:[{type:"quest",id:"qq-001",condition:"completed",description:"Fulfill the first quota."}],sections:[{id:"intro",text:"The administrative center is more active now, with several terminals showing colony metrics and production data. Your successful fulfillment of the first quota has brought a modicum of stability to Gamma-9.",isNarration:!0,next:"tavi-enters"},{id:"tavi-enters",text:"Tavi enters, datapad in hand, her usual composure visibly strained.",isNarration:!0,next:"tavi-notification"},{id:"tavi-notification",text:"Governor, we've received a priority transmission from Hegemony Oversight. They were... impressed. Which is never as good as it sounds.",character:"Tavi",next:"console-chimes"},{id:"console-chimes",text:"As she speaks, the main comms console emits the sharp chime of an incoming Hegemony priority signal. The stern face of a man materializes on screen, expression clinical and detached.",isNarration:!0,next:"dante-introduction"},{id:"dante-introduction",text:"Governor. Dante Yeoh, Hegemony Oversight Liaison. Your fulfillment of the initial quota has been noted.",character:"Dante",next:"dante-explanation"},{id:"dante-explanation",text:"Based on your demonstrated capabilities, your production requirements are being adjusted. Transmitting Resource Quota Package now.",character:"Dante",next:"console-beeps"},{id:"console-beeps",text:"Data fills the console: Significantly higher target amounts for Energy, Minerals, and Food. The numbers represent a substantial increase from your previous quota.",isNarration:!0,next:"dante-contact"},{id:"dante-contact",text:"Report progress towards quota fulfillment regularly. Oversight will monitor your management decisions carefully. Progress through Sacrifice, Governor.",character:"Dante",next:"transmission-ends"},{id:"transmission-ends",text:"The connection terminates. Tavi stares at the new quota figures, her expression hardening into something between resignation and determination.",isNarration:!0,next:"tavi-reaction"},{id:"tavi-reaction",text:"And there it is. Right on schedule. They didn't even wait a full cycle before nearly doubling the requirements. Seen this three times before.",character:"Tavi",next:"scene-end"},{id:"scene-end",text:"We'll need to expand significantly - more energy infrastructure, larger food production, increased mineral extraction. I hope you weren't planning on sleeping much, Governor. Welcome to the real job.",character:"Tavi"}],rewards:{questUnlocks:["qq-002"]},nextScenes:{"focus-expansion":"mq-001-s03","focus-efficiency":"mq-001-s03","focus-strategy":"mq-001-s03"}}}),1730,[]);
__d((function(g,r,i,a,m,e,d){Object.defineProperty(e,"__esModule",{value:!0}),e.mq001s03=void 0;e.mq001s03={id:"mq-001-s03",title:"First Strains",description:"The initial push for resources begins to show its effects on the nascent colony and its inhabitants.",requirements:[{type:"quest",id:"qq-002",condition:"completed",description:"Fulfill the second probation quota."}],sections:[{id:"time-passes",text:"Several cycles pass. The construction frames for new buildings rise slowly, a skeletal promise of future power. But its construction consumes precious materials and energy the sector barely possesses. Other systems run at minimum viable levels.",isNarration:!0,next:"tavi-report-start"},{id:"tavi-report-start",text:"Tavi finds you reviewing resource allocation readouts. Dark circles under her eyes betray sleepless cycles. The numbers are inching upwards, but remain deeply in deficit compared to Dante's required quotas.",isNarration:!0,next:"tavi-report-miners"},{id:"tavi-report-miners",text:"Governor. Need to report... trouble. Not that you'll be surprised.",character:"Tavi",next:"tavi-report-details"},{id:"tavi-report-details",text:"The extraction crews are running double shifts trying to source enough raw minerals for both construction AND the quota stockpile. They're exhausted. Three injuries yesterday alone. Ellis in Medical says they're running on stims, not sleep.",character:"Tavi",next:"tavi-report-habs"},{id:"tavi-report-habs",text:"And the power rationing for the construction site caused another life support 'brownout' in the residential blocks. Twenty minutes this time. Had to evacuate two sections. Got families sleeping in corridors now.",character:"Tavi",next:"tavi-straight-talk"},{id:"tavi-straight-talk",text:"I've been through quota crunches before, but this is aggressive even by Hegemony standards. People are asking if the Core knows we're humans, not machines. Or if they just don't care.",character:"Tavi",next:"stability-note"},{id:"stability-note",text:"Though no formal 'Stability Index' exists on your primitive console, you can feel it in Tavi's report: a fraying of collective will, the first signs of dissent bred from hardship.",isNarration:!0,next:"tavi-expectation"},{id:"tavi-expectation",text:"This is the cost of meeting Hegemony demands with nothing, Governor. 'Progress Through Sacrifice' sounds noble until you realize who's doing all the sacrificing. Never seems to be anyone from the Core, does it?",character:"Tavi",next:"player-choice-stability"},{id:"player-choice-stability",text:"She waits for your response, arms crossed, her expression a careful mix of professional deference and personal challenge.",isNarration:!0,choices:[{id:"choice-quota-focus-s3",text:"Hardship is temporary. Compliance is paramount.",nextSectionId:"response-quota-focus-s3",branchKey:"prioritize-quota"},{id:"choice-acknowledge-s3",text:"Their concerns are noted. Ensure basic safety protocols aren't being ignored.",nextSectionId:"response-acknowledge-s3",branchKey:"acknowledge-strain"},{id:"choice-ask-tavi-s3",text:"What do you suggest, Tavi? How do we balance this?",nextSectionId:"response-ask-tavi-s3",branchKey:"seek-tavi-advice"}]},{id:"response-quota-focus-s3",text:"'Paramount.' Easy word when you're not breathing rock dust 18 hours a cycle. Understood, Governor. Quotas first. I'll make it clear to the crew leads. I'm sure the Hegemony appreciates your... dedication.",character:"Tavi",next:"scene-end-narration"},{id:"response-acknowledge-s3",text:"'Basic safety' costs resources we don't have. But I'll pass the word down. Not sure it'll be enough. At least you're acknowledging the problem. That's more than the last one did.",character:"Tavi",next:"scene-end-narration"},{id:"response-ask-tavi-s3",text:"Balance? There's no balance out here, Governor. Only choices. Push the miners harder, risk more accidents, but get closer to quota. Or ease up, keep them safer, and fall behind. I'd rotate shifts more, if we had the personnel. But we don't.",character:"Tavi",next:"tavi-honest-opinion"},{id:"tavi-honest-opinion",text:"If you really want my opinion? The quotas are unreasonable. But that doesn't matter because they're not negotiable. So we do what Outer Reach colonies always do - we find a way or we break trying.",character:"Tavi",next:"scene-end-narration"},{id:"scene-end-narration",text:"Tavi gives a curt nod and exits. In her wake, the administrative center feels colder, the console readouts more demanding. Your colony teeters between compliance and collapse.",isNarration:!0}],rewards:{questUnlocks:["qq-003"]},nextScenes:{"prioritize-quota":"mq-001-s04","acknowledge-strain":"mq-001-s04","seek-tavi-advice":"mq-001-s04"}}}),1731,[]);
__d((function(g,r,i,a,m,e,d){Object.defineProperty(e,"__esModule",{value:!0}),e.mq001s04=void 0;e.mq001s04={id:"mq-001-s04",title:"The Reward for Compliance",description:"Achieving the probation quotas brings not relief, but a performance review and a stark escalation from Hegemony Oversight.",requirements:[{type:"quest",id:"qq-003",condition:"completed",description:"Fulfill the final probation quota."}],sections:[{id:"quota-met",text:"The final shipment uploads. Resource transfer confirmed. A wave of system notifications confirms: Initial Quota requirements met. For the first time since arrival, the critical resource warnings on the main console cease their incessant blinking. A fragile, temporary stability settles over Gamma-9.",isNarration:!0,next:"tavi-relief"},{id:"tavi-relief",text:"Tavi monitors the confirmation signals, a rare expression of weary relief crossing her features.",isNarration:!0,next:"tavi-surprise"},{id:"tavi-surprise",text:"'Honestly didn't think it was possible with what we started with. Maybe there's hope for this sector yet...'",character:"Tavi",next:"dante-interrupts"},{id:"dante-interrupts",text:"Her words are cut off by the sharp, demanding chime of the Hegemony priority channel.",isNarration:!0,next:"tavi-inevitable"},{id:"dante-appears",text:"Dante Yeoh's face appears on the main screen. His expression is precisely neutral, giving away nothing.",isNarration:!0,next:"dante-review-start"},{id:"dante-review-start",text:"Governor. Performance data for the initial operational cycle has been processed by Oversight Command.",character:"Dante",next:"dante-acknowledges"},{id:"dante-acknowledges",text:"Quota fulfillment is confirmed. Compliance registered.",character:"Dante",next:"dante-potential"},{id:"dante-potential",text:"Your administration's ability to meet these targets under baseline conditions demonstrates Sector Gamma-9's significant potential for enhanced resource contribution.",character:"Dante",next:"dante-transmitting-new"},{id:"dante-transmitting-new",text:"Consequently, your operational requirements are being adjusted. Transmitting revised Quota Package, effective immediately.",character:"Dante",next:"new-quota-data"},{id:"new-quota-data",text:"New data floods the console. The required quantities for Energy surplus, Minerals, and Foodstuffs are dramatically increased. A new line appears: Polymers, requiring a substantial quantity.",isNarration:!0,next:"dante-justification"},{id:"dante-justification",text:"Escalating strategic needs in the Core Worlds require maximum output from all sectors. Preliminary surveys indicate Gamma-9 possesses geological formations suitable for Polymer processing. Initiate protocols without delay.",character:"Dante",next:"dante-final"},{id:"dante-final",text:"Maintain compliance at these revised levels, Governor. The Hegemony requires results.",character:"Dante",next:"transmission-ends"},{id:"transmission-ends",text:"The screen blanks.",isNarration:!0,next:"tavi-reaction"},{id:"tavi-reaction",text:"Tavi stares, speechless for a moment, at the impossible figures now glowing on the console. Her earlier relief is replaced by stark disbelief, then hardening anger.",isNarration:!0,next:"tavi-outrage"},{id:"tavi-outrage",text:"'Enhanced contribution?' 'Proven capacity?' We bled this sector dry to meet the *first* quota! Those new numbers... they're not achievable, they're a death sentence for Gamma-9!",character:"Tavi",next:"tavi-gases"},{id:"tavi-conclusion",text:"This isn't about development anymore. This is desperation.",character:"Tavi",next:"player-choice-escalation"},{id:"player-choice-escalation",text:"The weight of the new quotas seems to press down on the small command center. Tavi looks to you, her anger mixed with a grim sort of challenge.",isNarration:!0,choices:[{id:"choice-accept-challenge-s4",text:"Accept the challenge, however impossible. 'We find a way. That's the job.'",nextSectionId:"response-accept-challenge-s4"},{id:"choice-question-feasibility-s4",text:"Question the logistics directly. 'Polymers this soon? Something's wrong. Can we report it?'",nextSectionId:"response-question-feasibility-s4"},{id:"choice-focus-truth-s4",text:"Focus on Tavi's conclusion. 'You're right. We need to know *why*.'",nextSectionId:"response-focus-truth-s4"}]},{id:"response-accept-challenge-s4",text:"'Find a way?' Governor, some things *can't* be done. But if you're determined to try... fine. Let's start by figuring out how to get processors up without crippling power.",character:"Tavi",next:"scene-end-narration"},{id:"response-question-feasibility-s4",text:"Report it? To Dante? He just gave the order! He knows it's unfeasible, that's likely the point. Reporting it will just flag you as defiant. We need a different approach.",character:"Tavi",next:"scene-end-narration"},{id:"response-focus-truth-s4",text:"Exactly. Knowing *why* might give us leverage, or at least help us predict their next move. But finding that truth... that's dangerous work, Governor.",character:"Tavi",next:"scene-end-narration"},{id:"scene-end-narration",text:"The brief respite is over. The Hegemony's reward for success is simply a heavier burden. More quotas loom, demanding action, while the question of 'why' hangs unanswered in the thin, recycled air. The true challenges of governing Gamma-9 are only just beginning.",isNarration:!0}],rewards:{questUnlocks:["qq-004"]},nextScenes:{"accept-impossible":"mq-001-s05","report-unfeasible":"mq-001-s05","seek-truth":"mq-001-s05"}}}),1732,[]);
